import React,{useState} from 'react'
import {MenuIcon,XIcons} from '@heroicons/react/outline'
import Menubar from './Menubar'
const Navbar = () => {
    const [display,setDisplay]=useState(false)
    const dropdown=()=>{
   setDisplay(!display)
    }
  return (
  <nav className='bg-blue-500'>
      <div>
          <img src='images/LOGO.jpg' className='w-20' />
          <ul className='hidden md:flex'>
              <li>Home</li>
              <li>Job Application Form</li>
              <li>Guarantor Form</li>
              <li>Contact</li>
          </ul>
      </div>
      <MenuIcon className='w-11 md:hidden' onClick={dropdown}/>
      {display && <Menubar/>}
  </nav>
  )
}

export default Navbar
